import './App.css';
import Favorites from './components/Favorites';
import Meal from './components/Meals';
import Modal from './components/Modal';
import Search from './components/Search';
function App() {
  return (
    <>
    <Meal/>
    <Modal/>
    <Search/>
    <Favorites/>
  </>
  );
}

export default App;
